import React, { PureComponent } from 'react'

export class Home extends PureComponent {
  render() {
    return (
      <div>
        <h2>Home counter : 0</h2>
        <div>
          <button>+1</button>
          <button>+3</button>
          <button>+5</button>
        </div>
      </div>
    )
  }
}

export default Home
